import React, { Component } from 'react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import "./style.css";
class Icon extends Component {
    render() {
        return (
                <FontAwesomeIcon className="icon" icon= {["fas", "music"]}/>
        );
    }
}

export default Icon;
